import Header from './Header';
import Footer from './Footer';
const Layout = ({children ,title ,props})=>(
    <section>
        <Header {...props}/>
            <title>{title}</title>

            {children}

        <Footer/>


    </section>
)

Layout.getInitialProps = async function() {
    await fetch(DISEASE_LIST_API)
    .then((res)=>{
        return res.json();
    })
    .then( (data) => {
        return {};
      console.log(data);
    });
}

export default Layout
